PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "accounts_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_customer" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "CustomerPhoto" varchar(100) NULL, "CreditCardNO" varchar(20) NULL, "CreditCardType" varchar(50) NULL, "CreditCardMonth" varchar(2) NULL, "CreditCardYear" varchar(4) NULL, "CreditCVV" varchar(3) NOT NULL, "user_id" bigint NOT NULL UNIQUE REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_follow" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Customer_id" bigint NOT NULL REFERENCES "accounts_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "Supplier_id" bigint NOT NULL REFERENCES "accounts_supplier" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_category" ("CategoryID" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Title" varchar(100) NOT NULL, "Description" text NOT NULL, "Picture" varchar(100) NULL, "Active" bool NOT NULL, "Slug" varchar(50) NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "products_matcategory" ("MatID" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Title" varchar(100) NOT NULL, "Picture" varchar(100) NULL, "Active" bool NOT NULL, "Slug" varchar(50) NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "products_procolors" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Color" varchar(20) NULL, "product_id" integer NOT NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_prosizes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Size" varchar(20) NULL, "product_id" integer NOT NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "orders_cart" ("id" char(32) NOT NULL PRIMARY KEY, "Created_at" datetime NULL, "User_id" bigint NOT NULL UNIQUE REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "orders_orderitem" ("id" char(32) NOT NULL PRIMARY KEY, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "price" decimal NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "order_id" char(32) NOT NULL REFERENCES "orders_order" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" integer NOT NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "course_coursevideos" ("VideoID" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "LectureTitle" varchar(100) NOT NULL, "VideoNo" integer NOT NULL, "Description" text NOT NULL, "VideoFile" varchar(100) NOT NULL, "CourseID_id" integer NOT NULL REFERENCES "course_course" ("CourseID") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "course_enrollment" ("EnrollmentID" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "EnrollmentDate" datetime NOT NULL, "Course_id" integer NOT NULL REFERENCES "course_course" ("CourseID") DEFERRABLE INITIALLY DEFERRED, "Customer_id" bigint NOT NULL REFERENCES "accounts_customer" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "token_blacklist_blacklistedtoken" ("blacklisted_at" datetime NOT NULL, "token_id" bigint NOT NULL UNIQUE REFERENCES "token_blacklist_outstandingtoken" ("id") DEFERRABLE INITIALLY DEFERRED, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "token_blacklist_outstandingtoken" ("token" text NOT NULL, "created_at" datetime NULL, "expires_at" datetime NOT NULL, "user_id" bigint NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "jti" varchar(255) NOT NULL UNIQUE, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "payment_paymenthistory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "date" datetime NOT NULL, "payment_status" bool NOT NULL, "order_id" char(32) NULL REFERENCES "orders_order" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "orders_cartitems" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Quantity" integer unsigned NOT NULL CHECK ("Quantity" >= 0), "CartID_id" char(32) NULL REFERENCES "orders_cart" ("id") DEFERRABLE INITIALLY DEFERRED, "Product_id" integer NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "orders_wishlist" ("id" char(32) NOT NULL PRIMARY KEY, "Created_at" datetime NOT NULL, "user_id" bigint NOT NULL UNIQUE REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "orders_wishlistitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "wishlist_id" char(32) NOT NULL REFERENCES "orders_wishlist" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" integer NOT NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_collection" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "supplier_id" bigint NOT NULL REFERENCES "accounts_supplier" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_collectionitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "collection_id" bigint NOT NULL REFERENCES "products_collection" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" integer NOT NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "orders_coupon_products" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "coupon_id" bigint NOT NULL REFERENCES "orders_coupon" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" integer NOT NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "orders_coupon" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(50) NOT NULL UNIQUE, "discount" decimal NOT NULL, "valid_from" datetime NOT NULL, "valid_to" datetime NOT NULL, "terms" text NOT NULL, "supplier_id" bigint NOT NULL REFERENCES "accounts_supplier" ("id") DEFERRABLE INITIALLY DEFERRED, "active" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "products_proimage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "product_id" integer NOT NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED, "image" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "reviews_review" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "rating" integer NOT NULL, "comment" text NOT NULL, "created_at" datetime NOT NULL, "course_id" integer NULL REFERENCES "course_course" ("CourseID") DEFERRABLE INITIALLY DEFERRED, "customer_id" bigint NOT NULL REFERENCES "accounts_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "delivery_id" bigint NULL REFERENCES "accounts_delivery" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" integer NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED, "supplier_id" bigint NULL REFERENCES "accounts_supplier" ("id") DEFERRABLE INITIALLY DEFERRED, "ease_of_place_order" varchar(50) NULL, "image" varchar(100) NULL, "product_packaging" varchar(50) NULL, "speed_of_delivery" varchar(50) NULL);
CREATE TABLE IF NOT EXISTS "notifications_notification" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "message" text NOT NULL, "timestamp" datetime NOT NULL, "is_read" bool NOT NULL, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "chatapp_conversation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "start_time" datetime NOT NULL, "initiator_id" bigint NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "receiver_id" bigint NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "chatapp_message" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "text" varchar(200) NOT NULL, "attachment" varchar(100) NOT NULL, "timestamp" datetime NOT NULL, "conversation_id_id" bigint NOT NULL REFERENCES "chatapp_conversation" ("id") DEFERRABLE INITIALLY DEFERRED, "sender_id" bigint NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "orders_warehouse" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "contact_person" varchar(100) NOT NULL, "contact_phone" varchar(20) NOT NULL, "Address_id" bigint NOT NULL REFERENCES "accounts_address" ("id") DEFERRABLE INITIALLY DEFERRED, "delivery_fee" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "accounts_address" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "Street" varchar(100) NOT NULL, "City" varchar(100) NOT NULL, "State" varchar(100) NOT NULL, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "BuildingNO" varchar(10) NULL);
CREATE TABLE IF NOT EXISTS "course_course" ("CourseID" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "CourseTitle" varchar(100) NOT NULL, "CourseHours" integer NULL, "Description" text NOT NULL, "Price" decimal NOT NULL, "Thumbnail" varchar(100) NULL, "FromDate" datetime NULL, "ToDate" datetime NULL, "address" text NULL, "completed" bool NOT NULL, "CategoryID_id" integer NOT NULL REFERENCES "products_category" ("CategoryID") DEFERRABLE INITIALLY DEFERRED, "Supplier_id" bigint NULL REFERENCES "accounts_supplier" ("id") DEFERRABLE INITIALLY DEFERRED, "Rating" decimal NOT NULL, "NumberOfRatings" integer NOT NULL, "NumberOfLec" integer NULL);
CREATE TABLE IF NOT EXISTS "accounts_user" ("password" varchar(128) NOT NULL, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "email" varchar(255) NOT NULL UNIQUE, "first_name" varchar(100) NOT NULL, "last_name" varchar(100) NOT NULL, "PhoneNO" varchar(14) NOT NULL, "is_staff" bool NOT NULL, "is_superuser" bool NOT NULL, "is_verified" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "last_login" datetime NOT NULL, "is_customer" bool NOT NULL, "is_supplier" bool NOT NULL, "is_delivery" bool NOT NULL, "last_password_reset_request" datetime NULL, "auth_provider" varchar(50) NOT NULL, "Balance" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "orders_order" ("id" char(32) NOT NULL PRIMARY KEY, "address_id" bigint NOT NULL REFERENCES "accounts_address" ("id") DEFERRABLE INITIALLY DEFERRED, "paid" bool NOT NULL, "status" varchar(50) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "cart_id" char(32) NULL REFERENCES "orders_cart" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "discount_amount" decimal NOT NULL, "final_amount" decimal NOT NULL, "total_amount" decimal NOT NULL, "confirmation_code" varchar(6) NULL, "delivery_confirmed_at" datetime NULL, "delivery_id" bigint NULL REFERENCES "accounts_delivery" ("id") DEFERRABLE INITIALLY DEFERRED, "from_state" varchar(250) NOT NULL, "product_id" integer NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED, "to_state" varchar(250) NOT NULL, "from_address_id" bigint NULL REFERENCES "accounts_address" ("id") DEFERRABLE INITIALLY DEFERRED, "delivery_fee" decimal NOT NULL, "initial_status" varchar(50) NOT NULL, "supplier_id" bigint NULL REFERENCES "accounts_supplier" ("id") DEFERRABLE INITIALLY DEFERRED, "payment_method" varchar(50) NOT NULL, "stripe_id" varchar(250) NULL, "related_order_id" char(32) NULL REFERENCES "orders_order" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "return_balance_withdraw_request" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "transfer_number" varchar(50) NOT NULL, "transfer_type" varchar(50) NOT NULL, "transfer_status" varchar(50) NOT NULL, "amount" decimal NOT NULL, "notes" text NULL, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "return_transactions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "transaction_type" varchar(50) NOT NULL, "amount" decimal NOT NULL, "created_at" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "return_returnrequest" ("id" char(32) NOT NULL PRIMARY KEY, "from_state" varchar(250) NOT NULL, "to_state" varchar(250) NOT NULL, "confirmation_code" varchar(6) NULL, "delivery_confirmed_at" datetime NULL, "status" varchar(50) NOT NULL, "initial_status" varchar(50) NOT NULL, "amount" decimal NOT NULL, "stripe_id" varchar(250) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "delivery_id" bigint NULL REFERENCES "accounts_delivery" ("id") DEFERRABLE INITIALLY DEFERRED, "from_address_id" bigint NULL REFERENCES "accounts_address" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" integer NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED, "related_order_id" char(32) NULL REFERENCES "return_returnrequest" ("id") DEFERRABLE INITIALLY DEFERRED, "supplier_id" bigint NULL REFERENCES "accounts_supplier" ("id") DEFERRABLE INITIALLY DEFERRED, "to_address_id" bigint NOT NULL REFERENCES "accounts_address" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "returnrequest_balance_withdraw_request" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "transfer_number" varchar(50) NOT NULL, "transfer_type" varchar(50) NOT NULL, "transfer_status" varchar(50) NOT NULL, "amount" decimal NOT NULL, "notes" text NULL, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
