CREATE TABLE IF NOT EXISTS "returnrequest_returnrequest" ("id" char(32) NOT NULL PRIMARY KEY, "quantity" integer NOT NULL, "from_state" varchar(250) NOT NULL, "to_state" varchar(250) NOT NULL, "confirmation_code" varchar(6) NULL, "delivery_confirmed_at" datetime NULL, "status" varchar(50) NOT NULL, "initial_status" varchar(50) NOT NULL, "amount" decimal NOT NULL, "stripe_id" varchar(250) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "delivery_id" bigint NULL REFERENCES "accounts_delivery" ("id") DEFERRABLE INITIALLY DEFERRED, "from_address_id" bigint NULL REFERENCES "accounts_address" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" integer NULL REFERENCES "products_product" ("id") DEFERRABLE INITIALLY DEFERRED, "related_order_id" char(32) NULL REFERENCES "returnrequest_returnrequest" ("id") DEFERRABLE INITIALLY DEFERRED, "supplier_id" bigint NULL REFERENCES "accounts_supplier" ("id") DEFERRABLE INITIALLY DEFERRED, "to_address_id" bigint NOT NULL REFERENCES "accounts_address" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "order_id" char(32) NULL REFERENCES "orders_order" ("id") DEFERRABLE INITIALLY DEFERRED);
